const Terms = () => {
  return (
    <div className="max-w-7xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-4">Kullanım Şartları</h1>
      <p>
        Buraya kullanım şartları içeriği gelecek.
      </p>
    </div>
  );
};

export default Terms;
